export const processImageWithAzure = async (imageUrl) => {
    try {
      console.log("Processing image:", imageUrl);

      // Mock response for now, replace with actual Azure API call
      return { message: "Image processed successfully!", imageUrl };
    } catch (error) {
      console.error("Error processing image:", error);
      return { error: "Failed to process image" };
    }
  };
